import React, { Component } from 'react'
 import Name from './Name'

export default class LiftSi extends Component {
    render() {

     var  name = this.props.allVidio.map((ele,i) => {

        return <Name name = {ele.snippet.title} handelEventselect ={this.props.handelEventselect} ele ={ele}/> 
    })  
        return (
            <div className="left">
            <div className="Instructors">
                <h2 className="coror">Welcome to</h2>
                <h4 className="coror">Instructors board</h4>
            </div>
           {name}

</div>
        )
    }
}
